const Event = (props) =>
{
    return (
        <div>
            <h3>Название: {props.event.name}</h3>
            <h3>Дата: {props.event.date}</h3>
            <h3>Время: {props.event.time}</h3>
            <h3>Описание: {props.event.body}</h3>
            <h3>Место: {props.event.place}</h3>
            <button>Изменить</button>
        </div>
    )
}

export default Event;
